    false,nt"url": null,nt"notes": "This annual narrative report for Alligator
    River and Pea Island National Wildlife Refuges summarizes refuge activities during
    1992.  The report begin with an introduction to the refuge and a summary of the
    yearu2019s climatic and habitat conditions. Land acquisition is covered in the next
    section.  Planning and administration sections are provided next. There is a habitat
    management section which covers wetlands, forests and croplands. The wildlife section
    of the report provides information on endangered/threatened species, waterfowl and
    game animals. There is also a section on public use; specifically, hunting, fishing
    and trapping. The final section discusses new construction and maintenance projects
    at the refuges.",nt"license_title": "License Not Specified",nt"extras":
